import React from "react";
import { useNavigate } from "react-router-dom";
import GroupData from "./Group.jsx";

const ShowData = ({ groupData }) => {
    const navigate = useNavigate();

    return (
        <div>
            <GroupData {...groupData} />

            <div className="button-wrapper">
                
            </div>
            <button
                onClick={() => {
                    navigate("/AddExpense");
                }}
            >
                Add Expense
            </button>
        </div>
    );
};

export default ShowData;
